All credentials must include a signature over themselves to prove possession of the signature key. The credential structs thus have the following structure. struct CredentialPayload { // ... credential data
} struct CredentialSelfSignedPayload { payload: CredentialPayload, // SignWithLabel(., "CredentialPayload", CredentialPayload) self_signature: Signature,
} struct Credential { signed_payload: CredentialSelfSignedPayload, // SignWithLabel(., "CredentialSelfSignedPayload", CredentialSelfSignedPayload) signature: Signature,
} Note that the types of the individual credential types below must have their own distinct names so that the resulting signatures are specific to a credential type and cannot be used for a confusion attack. In the following sections, we only describe the CredentialPayload struct for each credential.

