To allow connection establishment in the first place, the user's client publishes connection packages with the AS. Connection packages can be published both under the user's user id. Additionally, connection package payloads can be published under any of the user's registered aliases. As the aliases should not be associated with the user id of the creating user, or any other registered alias, the payloads lack the user's client's client credential and signature. Users also shouldn't use the same connection encryption key across multiple aliases and their user id. struct ConnectionPackagePayload { encryption_key: ConnectionEncryptionKey, lifetime: ExpirationData,
} struct ConnectionPackage { payload: ConnectionPackagePayload, client_credential: ClientCredential, // TBS: All information above signed by the ClientCredential. signature: Signature,
} When discovering a user (either by user id or user name), the initiator fetches a connection package for the user's client. The initiator then creates a new group and sends a ConnectionEstablishmentPackage to the responder's client. struct ConnectionEstablishmentPackage { sender_client_credential: ClientCredential, connection_group_id: GroupId, connection_group_ear_key: GroupStateEarKey, connection_group_credential_key: CredentialEarKey, // TBS: All information above signed by the ClientCredential. signature: Signature,
} The ConnectionEstablishmentPackage is signed using the initiator's client credential and encrypted under the ConnectionEncryptionKey included in the connection package. The receiving client must verify the signature on the package and fetch the AS credential and AS intermediate credential to verify the signature chain from the initiator's client credential to the AS credential. The responder can then decide based on the sender's user name (contained in the client credential) if it wants to accept the connection. The responder accepts the connection by fetching the external commit information required to join the group from the initiator's DS and joins the group via the join connection group endpoint of said DS.

